import React from 'react';

const EtAvant = () => (
  <>
    <h2>Et avant ?</h2>
      <p>Collectionneur de bac+2 (bientôt le troisième) je n'ai pas construit de carrière mais travaillé en fonction d’appétences diverses et parfois contradictoires. Suite à des études dans l'environnement j'ai découvert le monde de l'animation. J'ai été directeur/animateur d'une structure jeunesse (patience, écoute, empathie et de nombreux montages de projets/séjours avec les jeunes). Ce qui ne devait être qu'une parenthèse de quelques mois durera 8 ans. Après m'être formé seul, je devient bijoutier. C'est seulement récemment suite à la reconversion réussi d'un proche que le métier de développeur semble accessible. Je découvre alors l'incroyable bienveillance et l'immensité des connaissances disponibles sur le net. Je m'inscrit de suite à la Wild Code School de Nantes. Je n'en suis qu'au début de mon aventure mais j'adore créer de nouvelles fonctionnalités, les voir s'afficher et fonctionner.
        </p>
  </>
);

export default EtAvant;
